var loginformEl = document.querySelector(".form");
var inputEl = loginformEl.querySelector("input");
var usernameEl = document.querySelector(".username");
var signoutBtn = document.querySelector(".signoutbtn");
var HIDDEN = "hidden";
var USER = "windows95 todo-list username";
var userLocaldata = localStorage.getItem(USER);
if (userLocaldata) {
  printUsername(userLocaldata);
} else {
  loginformEl.classList.remove(HIDDEN);
}

//sign in(input user name)
loginformEl.addEventListener("submit", function (e) {
  e.preventDefault();
  var username = inputEl.value;
  localStorage.setItem(USER, username);
  loginformEl.classList.add(HIDDEN);
  printUsername(username);
});

//print user name
function printUsername(username) {
  usernameEl.innerText = "".concat(username, "!!!!!!!");
  usernameEl.classList.remove(HIDDEN);
  signoutBtn.classList.remove(HIDDEN);
}

//sign out
signoutBtn.addEventListener("click", signout);
function signout() {
  localStorage.removeItem(USER);
  inputEl.value = "";
  loginformEl.classList.remove(HIDDEN);
  usernameEl.classList.add(HIDDEN);
  signoutBtn.classList.add(HIDDEN);
}
